import { useState } from 'react';
import './App.css';
import HeaderWithMenu from './compornent/HeaderWithMenu';

function App() {
    const [isRegistered, setIsRegistered] = useState();
    return (
    <>
        <HeaderWithMenu setIsRegistered={setIsRegistered} />
    </>
    );
}

export default App;
